import React from "react";

function BenefitGroup(image, text) {
  return (
    <div className="benefit-group">
      <div className="benefit-group-img">
        <i class="fas fa-cannabis"></i>
      </div>
      <div className="benefit-group-text">
        <p>{text}</p>
      </div>
    </div>
  );
}

export default BenefitGroup;
